import { StripePaymentElement } from '@stripe/stripe-js';

const CheckoutForm = () => {
  return (
    <form>
      <StripePaymentElement>
        <button>Submit</button>
      </StripePaymentElement>
    </form>
  );
};

export default CheckoutForm;
